// profileSelectors.js
import { createSelector } from '@reduxjs/toolkit';

export const selectProfile = (state) => state.profile.profile;

export const selectPosts = (state) => state.profile.posts;

export const selectComments = (state) => state.profile.comments;

export const selectLikedPosts = (state) => state.profile.likedPosts;

export const selectNewComment = (state) => state.profile.newComment;

export const selectReplyingToCommentId = (state) => state.profile.replyingToCommentId;
